import PropTypes from 'prop-types'
import React, { Component } from 'react'

import Color from '../control_components/Color'

export default class ColorEffect extends Component {
  constructor(props) {
    super(props)
  }

  // Можно спользовать обновление тут, так как
  // componentDidUpdate() {
  // this.updateNodeParams()
  // }

  handlePropertyValueChange = (property, value) => {
    const { id, handlePropertyValueChange } = this.props
    handlePropertyValueChange(id, property, value)
  }

  render() {
    return (
      <div className="ColorEffect">
        <h1>{name}</h1>

        <Color
          name="ColorEffect"
          property={['value']}
          min={0}
          max={250}
          step={0.01}
          value={value}
          handleChange={this.handlePropertyValueChange}
        />
      </div>
    )
  }
}

ColorEffect.propTypes = {
  id: PropTypes.number.isRequired,
  name: PropTypes.string.isRequired,
  node: PropTypes.object.isRequired,
  settings: PropTypes.object.isRequired,
  handlePropertyValueChange: PropTypes.func.isRequired
}
